import React, { useEffect, useState } from "react";

import {APIProvider, Map} from '@vis.gl/react-google-maps'

export const Google_Map = () => {

const [Current_Location, setCameraProps] = useState(INITIAL_LOCATION);

const INITIAL_LOCATION = {
        zoom : 15,
        center : {lat: 40.7, lng: -74}
}

const Loaded_Successfullly = (Input) => {

        const Updated_Location = {
            zoom : 15,
            center : {lat: Input.coords.latitude, lng: Input.coords.longitude}
        }

        setCameraProps(Updated_Location)
}

const Loading_Loaction = () =>{

    switch(navigator.geolocation){
        case(true):
            navigator.geolocation.getCurrentPosition(Loaded_Successfullly)
    
        case(false):
            return;    
    }

}

useEffect(()=>{

    Loading_Loaction()
    
},[])


return <React.Fragment>

            <APIProvider apiKey={`${process.env.REACT_APP_API}`}>

                <Map
                
                    style={ 
                        { width:'inherit',
                        height:'20vh',
                        backgroundColor:'white',
                        margin: '3vh 6vw 0 10vw',
                        border: 'black solid 5px'
                        }}
                    
                    {...Current_Location} 
                    />

            </APIProvider>


</React.Fragment>

}

export default Google_Map
